complete_model_interaction.output:
Step 1: Key psychological mechanisms  
• A fairness norm is assumed such that a proposer’s offer is influenced by the relative contributions (i.e. number of tokens produced) of opponent versus self. This yields a fair share that would equal the opponent’s relative contribution from the total tokens.  
• The proposer, however, might deviate from an exact fairness rule (50% when contributions are equal or the exact proportional share when unequal) by over‐ or undercompensating in response to the experimental manipulation (as indicated by trial_type).  
• There is also an influence of trial context (coded by trial_type) that may push proposals away from the simple token-ratio “fair” division.  

Step 2: How mechanisms interact  
• The model computes a fairness ratio as the opponent’s token contribution divided by the total tokens (token_self + token_opp) times 100 (to convert to a percentage), representing the ideal fair share.  
• The proposer then adjusts this fair share by a factor controlling the weight on fairness (lambda_fair) and an additive effect modulated by the trial context (lambda_trial) after centering trial_type.  
• Noise is added to capture variability in behavior.  

Step 3: Mathematical formulation  
• Let fair_share = (token_opp/(token_self+token_opp))×100  
• Then, the predicted proposed percentage is a baseline of 50, adjusted by the deviation of fair_share from 50 (capturing fairness inconsistency) and modulated by trial_type effects.  
• An additive normally distributed error term scaled by sigma_noise is included.  

Step 4: Learnable parameters and finite bounds  
• lambda_fair: Weight on the fairness deviation, with generous bounds (e.g. [–10, 10]).  
• lambda_trial: Weight on the (centered) trial_type effect, with bounds [–10, 10].  
• sigma_noise: Standard deviation of error, with bounds (0, 100].  

Step 5: Mapping to observables  
• token_self, token_opp, and trial_type are observed inputs from each proposal instance (when the participant acts as a proposer).  
• The computed fair_share informs how far a proposal deviates from an equal split (50%).  
• The model predicts proposed_perc (the percentage of the total pot that is offered to the opponent) and its deviation from fair division.

Below is the formal specification:

<MODEL>
proposed_perc = 50 + lambda_fair * (((token_opp/(token_self+token_opp))*100) - 50) + lambda_trial * (trial_type - 2) + sigma_noise * epsilon
</MODEL>

