        "inclusive_max": true
      },
      "learnable": false,
      "source": "data"
    },
    "trial_type": {
      "description": "Trial type indicator reflecting contribution context (1: equal, 2: opponent more, 3: participant more)",
      "range": {
        "min": 1,
        "max": 3,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": false,
      "source": "data"
    },
    "lambda_fair": {
      "description": "Learnable weight for fairness deviation (influence of computed fair share deviation from 50)",
      "range": {
        "min": -10,
        "max": 10,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": true,
      "source": "learnable"
    },
    "lambda_trial": {
      "description": "Learnable weight for the effect of trial type (centered by subtracting 2)",
      "range": {
